import React from 'react';
import VerticalNavBar from './VerticalNavBar';
import './App.css';

function App() {
  return (
    <div className="App">
      <VerticalNavBar/>
      <div className="intro-text">Hi there! I'm Laura.</div>
    </div>
  );
}

export default App;
